import Hero from "./components/hero" */
import Cards from "./components/cards"
/* import Jokes from "./components/joke" */

export default function App() {

            const imgFrame = Data.map(card => {
                return (
                    <Cards
                    key = {card.id}
                    coverImg ={card.coverImg}
                    grade = {card.grade}
                    country = {card.country}
                    title = {card.title}
                    price = {card.price}
                    />
                )
            })
            return (
                <div>
                    {imgFrame}
                </div>
            )
            
          
}
